import {ToastContainer} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './App.css';

function App() {
  return (
    <div className="App">
      <ToastContainer position='top-center' />
      <h2>Hello React</h2>
    </div>
  );
}

export default App;
